import { TouchableOpacity, Text } from "react-native";
import componentsStyle from "../styles/components";
import theme from "../styles/theme";

const Button = ({ text, type, ...properties }) => {
    return (
        <TouchableOpacity
            style={[componentsStyle.button, {backgroundColor: theme[type || "primary1"]}]}
            {...properties}
        >
            <Text style={componentsStyle.textButton}>{text}</Text>
        </TouchableOpacity>
    );
}

export default Button;
